import './App.css';
import Home from './Components/Home';
import Test from './Test';
import React from 'react';
import './css/layout.css';
import { Routes, Route} from 'react-router-dom';
function App() {
  return (
    <div className="App">
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />}/>
        <Route path="/test" element={<Test />}/>
      </Routes>
    </div>
  );
}

export default App;
